import React, {useState} from 'react';
// import styled from 'styled-components'

import { Gallery, GalleryImage } from 'react-gesture-gallery'

const images = [{
  url : cyzone1,
  brand : "CYZONE" 
},{
  url : cyzone2,
  brand : "CYZONE"
},{
  url : esika1,
  brand : "ESIKA"
},{
  url : esika2,
  brand : "ESIKA"
},{
  url : esika3,
  brand : "ESIKA"
}];

export const Slider = () => {
  return(
    <Gallery index={0}>
      {images.map(img => (
        <GalleryImage src={img.url} />
      ))}

    </Gallery>
  )
};
